      SELECT - - 27 + + - 6 - + - 40 + + - COALESCE ( + - 2, - 74 / + 1, 19 / + ( 88 ) + + 72 * + + COUNT ( DISTINCT ( + 74 ) ) * + COALESCE ( - + 74, + - 67, - 16 ) ) AS col1;

outputs:
  - name: q6502.out
    data: |
      63
